        - Сегодня нашел странное яйцо на обшивке, по всей видимости в яйце было нечто неизвестное науке.




        - Это "нечто" имеет способности к созданию магнитных полей, тоесть оно работает как комуникатор. В дальнейшем буду называть обьект "симбиот"



